import Counter from "./Counter";
import Card from 'react-bootstrap/Card';
import pic from "./../images/profilePic.jpeg"

function Foodcard() {
  return (
    <Card style={{ maxWidth: '300px', maxHeight: "500px"}}>
      <Card.Img variant="top" src={pic} style={{height:"200px"}} />
      <Card.Body>
        <Card.Title>Paneer pizza</Card.Title>
        <Card.Text>Flavorful trio: paneer, capsicum, red paprika</Card.Text>
        <div className="price-and-count">
          <div className="price">$300</div>
          <Counter/>
        </div>
      </Card.Body>
    </Card>
    );
}

export default Foodcard;
